import "./App.css";
import Header from './components/Header/Header';
import Body from './components/Body/Body';


const Navi = () => {
  return <div className="navi"></div>;
};

const Footer = () => {
  return <div className="footer"></div>;
};


function App() {
  return (
    <div className="container">
      <Header />
      <Navi />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
